local moons = {}

local function fn(client)
	local decode = require('json').decode
	local request = require('coro-http').request
	local clock = require('discordia').Clock()
	local oldPhase
	clock:on('hour', function(date)
		if date.hour % 6 ~= 0 then return end
		local _, data = request('GET', "http://api.usno.navy.mil/rstt/oneday?date=today&loc=New%20York,%20NY&ID=Discord")
		data = decode(data)
		if not data then return end
		if data.error then
			client:warning(data.type)
		else
			local newPhase = data.curphase or data.closestphase.phase
			if newPhase ~= oldPhase then
				client:setAvatar(moons[newPhase])
				oldPhase = newPhase
			end
		end
	end)
	clock:start()
end

moons["First Quarter"] = "data:image/jpeg;base64,"

moons["Full Moon"] = "data:image/jpeg;base64,"

moons["Last Quarter"] =  "data:image/jpeg;base64,"

moons["New Moon"] =  "data:image/jpeg;base64,"

moons["Waning Crescent"] = "data:image/jpeg;base64,"

moons["Waning Gibbous"] = "data:image/jpeg;base64,"

moons["Waxing Crescent"] = "data:image/jpeg;base64,"

moons["Waxing Gibbous"] = "data:image/jpeg;base64,"

return fn
